1041C0700X	1041C0700X	Behavioral Health & Social Service Providers	Social Worker	Clinical	A social worker who holds a masters or doctoral degree in social work from an accredited school of social work in addition to at least two years of post-masters supervised experience in a clinical setting. The social worker must be licensed, certified, or registered at the clinical level in the jurisdiction of practice. A clinical social worker provides direct services, including interventions focused on interpersonal interactions, intrapsychic dynamics, and life management issues. Clinical social work services are based on bio-psychosocial perspectives. Services consist of assessment, diagnosis, treatment (including psychotherapy and counseling), client-centered advocacy, consultation, evaluation, and prevention of mental illness, emotional, or behavioral disturbances.	Source: National Association of Social Workers, 2008 [7/1/2009: definition modified]	\N	\N	\N	metaTaxonomyCode:1041C0700X	\N	\N	\N	\N	\N	f
