111NI0013X	111NI0013X	Chiropractic Providers	Chiropractor	Independent Medical Examiner	A special evaluator not involved with the medical care of the individual examinee that impartially evaluates the care being provided by other practitioners to clarify clinical, disability, liability or other case issues.	Source: American Board of Independent Medical Examiners [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:111NI0013X	\N	\N	\N	\N	\N	f
111NI0900X	111NI0900X	Chiropractic Providers	Chiropractor	Internist	The chiropractic internist may serve as a primary care physician or may see patients referred from other providers for evaluation and co-management. Evaluation is focused on the early detection of functional, nutritional, and pathological disorders. A chiropractic internist utilizes the diagnostic instruments necessary for proper examination. In cases where laboratory examination is necessary, a chiropractic internist utilizes a recognized reference laboratory facility. A chiropractic internist may manage his or her own cases or may refer to another specialist when prudent to do so. The chiropractic internist utilizes documented natural therapies, therapeutic lifestyle changes, patient education and other resources to promote patient health and avoidance of disease.	Source: American Chiropractic Association, 2008 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:111NI0900X	\N	\N	\N	\N	\N	f
111NN0400X	111NN0400X	Chiropractic Providers	Chiropractor	Neurology	Chiropractic Neurology is defined as the field of functional neurology that engages the internal - and external environment of the individual in a structured and targeted approach to affect positive changes in the nervous system and consequently the physiology and behavior of an individual. Chiropractic Neurologists are board-certified specialists in non-drug, non-surgical care for those with neurologically based health problems. There are many conditions people suffer from that are in this broad category: learning and attention disorders, headaches, vertigo, pain syndromes, developmental disorders, nerve injury, spinal cord injury, head injury or stroke, movement disorders, and many other conditions.	Source: American Chiropractic Neurology Board, 2008 & American Chiropractic Association, 2008 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:111NN0400X	\N	\N	\N	\N	\N	f
122300000X	122300000X	Dental Providers	Dentist	\N	A dentist is a person qualified by a doctorate in dental surgery (D.D.S.) or dental medicine (D.M.D.), licensed by the state to practice dentistry, and practicing within the scope of that license.  There is no difference between the two degrees: dentists who have a DMD or DDS have the same education.  Universities have the prerogative to determine what degree is awarded.  Both degrees use the same curriculum requirements set by the American Dental Association's Commission on Dental Accreditation.  Generally, three or more years of undergraduate education plus four years of dental school is required to graduate and become a general dentist.  State licensing boards accept either degree as equivalent, and both degrees allow licensed individuals to practice the same scope of general dentistry.  Additional post-graduate training is required to become a dental specialist.	Source: Council on Dental Education and Licensure, American Dental Association	\N	\N	\N	metaTaxonomyCode:122300000X	\N	\N	\N	\N	\N	f
111NN1001X	111NN1001X	Chiropractic Providers	Chiropractor	Nutrition	Chiropractic Nutrition is that specialty within the chiropractic profession that deals with the overall factors that affect the patient's ability to maintain the manipulative correction and thus sustain better neurological integrity. The Chiropractic Nutrition Specialist will perform extensive research on the patient's previous health history, ethnicity, and any family history related to what the patient is being treated for. Patients fill out questionnaires concerning dietary and sleep patterns and previous or present symptomology. A nutrition examination would be performed to assess areas such as absorption rates, adrenal function, kidney health, lung health etc. The patient is often instructed on how to check the pH of their saliva and urine, test for the presence of Candida Albicans, etc., at home. Outside laboratory testing includes blood, urine, hair analysis, food allergy testing etc. The patients prescription and over the counter medications are recorded and analyzed.	Source: American Chiropractic Association, 2008 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:111NN1001X	\N	\N	\N	\N	\N	f
111NP0017X	111NP0017X	Chiropractic Providers	Chiropractor	Pediatric Chiropractor	The Pediatric Chiropractor is a chiropractor with specialized, advanced training and certification in the evaluation, care and management of health and wellness conditions of infancy, childhood and adolescence.  This specialist provides primary, comprehensive, therapeutic and preventative chiropractic health care for newborns through adolescents.	Source: Council on Chiropractic Pediatrics, American Chiropractic Association, 2007  [1/1/2008: new]	\N	\N	\N	metaTaxonomyCode:111NP0017X	\N	\N	\N	\N	\N	f
111NR0200X	111NR0200X	Chiropractic Providers	Chiropractor	Radiology	Chiropractic radiology is a referral specialty that provides consultation services at the request of other qualified doctors. Chiropractic radiologists provide consultation in health care facilities (private offices, hospitals and teaching institutions) to meet the needs of referring doctors and their patients. The quality of the consultative services by the chiropractic radiologist in independent practice is reflected by the quality of their professional credentials. Chiropractic radiologists recommend, supervise, and interpret radiologic studies as well as advanced imaging procedures. They advise referring physicians on the necessity and appropriateness of radiologic services and whether to select or to avoid certain diagnostic or clinical procedures. In some instances the radiologist may act as a private practitioner. They may conduct research and apply diagnostic radiologic procedures and may be called upon to act as expert witnesses in matters of litigation.    Chiropractic radiologists are also concerned with imaging technology including image production, demonstration of normal and abnormal anatomy, and the interaction of energy and matter. The advances in the technological facets of radiology are so rapid that only qualified radiologists can reasonably be expected to maintain the high level of proficiency required to supervise and interpret these procedures. The practice of radiology continuously involves the application of this technology to patient imaging and treatment.    It is now well recognized that chiropractic radiology includes, but is not limited to, plain film radiography, fluoroscopy, tomography, ultrasonography, radioisotope imaging, computed tomography, digital radiography, and magnetic resonance imaging. Individual practices may vary by intent, licensure, and scope of practice laws.	Source: American Chiropractic Board of Radiology, 2009 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:111NR0200X	\N	\N	\N	\N	\N	f
111NR0400X	111NR0400X	Chiropractic Providers	Chiropractor	Rehabilitation	Rehabilitation is the discipline focused on restoring a patient's functional abilities to pre-injury or pre-disease status. Functional abilities are defined as those activities in one's daily life, work, or sports and recreational activities that an individual participates in. Relevant impairments (e.g. strength, endurance, flexibility, motor control, etc.) are often intermediate goals of rehabilitation, but the final goal of successful care is return to participation in activities in which the patient was successful before the onset of the injury or disease. Essential to a rehabilitation approach is a focus on patient-centered outcomes such as independence and self-management or self-care skills.	Source:  The American Chiropractic Association (ACA) and the ACA Council on Physiological Therapeutics [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:111NR0400X	\N	\N	\N	\N	\N	f
111NS0005X	111NS0005X	Chiropractic Providers	Chiropractor	Sports Physician	A sports chiropractor is uniquely trained to provide care and treatment of injuries or illness resulting from sports and physical fitness activities.  Doctors of Chiropractic with the Diplomate American Chiropractic Board of Sports Physicians (DACBSP) or the Certified Chiropractic Sports Physician (CCSP), sport specialty certifications from the American Chiropractic Board of Sports Physicians, have advanced training in the assessment, management and rehabilitation of sports related injuries. Extremity care, rehabilitation and soft tissue procedures are common skills utilized by these doctors. The specialty training covers a broad spectrum from the pediatric athlete to professional and Olympic athletes, and everything in between, using a variety of techniques and modalities.	Source: American Chiropractic Board of Sports Physicians, 2009 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:111NS0005X	\N	\N	\N	\N	\N	f
