1223P0300X	1223P0300X	Dental Providers	Dentist	Periodontics	That specialty of dentistry which encompasses the prevention, diagnosis and treatment of diseases of the supporting and surrounding tissues of the teeth or their substitutes and the maintenance of the health, function and esthetics of these structures and tissues.	Source: Council on Dental Education and Licensure, American Dental Association	\N	\N	\N	metaTaxonomyCode:1223P0300X	\N	\N	\N	\N	\N	f
1223P0700X	1223P0700X	Dental Providers	Dentist	Prosthodontics	That branch of dentistry pertaining to the restoration and maintenance of oral functions, comfort, appearance and health of the patient by the restoration of natural teeth and/or the replacement of missing teeth and contiguous oral and maxillofacial tissues with artificial substitutes.	Source: Council on Dental Education and Licensure, American Dental Association	\N	\N	\N	metaTaxonomyCode:1223P0700X	\N	\N	\N	\N	\N	f
1223S0112X	1223S0112X	Dental Providers	Dentist	Oral and Maxillofacial Surgery	The specialty of dentistry which includes the diagnosis, surgical and adjunctive treatment of diseases, injuries and defects involving both the functional and esthetic aspects of the hard and soft tissues of the oral and maxillofacial region.	Source: Council on Dental Education and Licensure, American Dental Association	\N	\N	\N	metaTaxonomyCode:1223S0112X	\N	\N	\N	\N	\N	f
1223X0008X	1223X0008X	Dental Providers	Dentist	Oral and Maxillofacial Radiology	The specialty of dentistry and discipline of radiology concerned with the production and interpretation of images and data produced by all modalities of radiant energy that are used for the diagnosis and management of diseases, disorders and conditions of the oral and maxillofacial region.	Source: Council on Dental Education and Licensure, American Dental Association	\N	\N	\N	metaTaxonomyCode:1223X0008X	\N	\N	\N	\N	\N	f
1223X0400X	1223X0400X	Dental Providers	Dentist	Orthodontics and Dentofacial Orthopedics	That area of dentistry concerned with the supervision, guidance and correction of the growing or mature dentofacial structures, including those conditions that require movement of teeth or correction of malrelationships and malformations of their related structures and the adjustment of relationships between and among teeth and facial bones by the application of forces and/or the stimulation and redirection of functional forces within the craniofacial complex.  Major responsibilities of orthodontic practice include the diagnosis, prevention, interception and treatment of all forms of malocclusion of the teeth and associated alterations in their surrounding structures; the design, application and control of functional and corrective appliances; and the guidance of the dentition and its supporting structures to attain and maintain optimum occlusal relations in physiologic and esthetic harmony among facial and cranial structures.	\N	\N	\N	\N	metaTaxonomyCode:1223X0400X	\N	\N	\N	\N	\N	f
122400000X	122400000X	Dental Providers	Denturist	\N	Definition to come.	\N	\N	\N	\N	metaTaxonomyCode:122400000X	\N	\N	\N	\N	\N	f
124Q00000X	124Q00000X	Dental Providers	Dental Hygienist	\N	An individual who has completed an accredited dental hygiene education program, and an individual who has been licensed by a state board of dental examiners to provide preventive care services under the supervision of a dentist.  Functions that may be legally delegated to the dental hygienist vary based on the needs of the dentist, the educational preparation of the dental hygienist and state dental practice acts and regulations, but always include, at a minimum, scaling and polishing the teeth.  To avoid misleading the public, no occupational title other than dental hygienist should be used to describe this dental auxiliary.	Source: Comprehensive Policy Statement on Dental Auxiliaries, American Dental Association.	\N	\N	\N	metaTaxonomyCode:124Q00000X	\N	\N	\N	\N	\N	f
125J00000X	125J00000X	Dental Providers	Dental Therapist	\N	A Dental Therapist is an individual who has completed an accredited or non-accredited dental therapy program and who has been authorized by the relevant state board or a tribal entity to provide services within the scope of their practice under the supervision of a dentist. Functions that may be delegated to the dental therapist vary based on the needs of the dentist, the educational preparation of the dental therapist and state dental practice acts and regulations.	Source: Summarized from Minnesota Statute 150A.105. [7/1/2012: new]	\N	\N	\N	metaTaxonomyCode:125J00000X	\N	\N	\N	\N	\N	f
146D00000X	146D00000X	Emergency Medical Service Providers	Personal Emergency Response Attendant	\N	Individuals that are specially trained to assist patients living at home with urgent/emergent situations.  These individuals must be able to perform CPR and basic first aid and have sufficient counseling skills to allay fears and assist in working through processes necessary to resolve the crisis.  Functions may include transportation to various facilities and businesses, contacting agencies to initiate remediation service or providing reassurance.	\N	\N	\N	\N	metaTaxonomyCode:146D00000X	\N	\N	\N	\N	\N	f
125K00000X	125K00000X	Dental Providers	Advanced Practice Dental Therapist	\N	An Advanced Practice Dental Therapist is:<br/>(1) A dental therapist who has completed additional training beyond basic dental therapy education and provides dental services in accordance with state advanced practice dental therapist laws or statutes; or<br/>(2) A dental hygienist with a graduate degree in advanced dental therapy prepared for independent and interdependent decision making and direct accountability for clinical judgment across the dental health care continuum.<br/><br/>The individual has been authorized by the relevant state board or a tribal entity to provide services under the remote supervision of a dentist. The functions of the advanced practice dental therapist vary based on the needs of the dentist, the educational preparation of the advanced practice dental therapist and state dental practice acts and regulations.	Source: Summarized from Minnesota Statute 150A.106. [7/1/2012: new]	\N	\N	\N	metaTaxonomyCode:125K00000X	\N	\N	\N	\N	\N	f
125Q00000X	125Q00000X	Dental Providers	Oral Medicinist	\N	A dentist with advanced training specializing in the recognition and treatment of oral conditions resulting from the interrelationship between oral disease and systemic health. The Oral Medicinist manages clinical and non-surgical treatment of non-dental pathologies affecting the oral and maxillofacial region, such as cancer, organ transplants, and acute and chronic pain. Activities include provision of interdisciplinary patient care in collaboration with medical specialists and other dentists in hospitals and outpatient medical clinics in the management of patients with complex medical conditions requiring multidisciplinary healthcare intervention.	Source: National Uniform Claim Committee [1/1/2015: new]  Additional Resources: American Academy of Oral Medicine	\N	\N	\N	metaTaxonomyCode:125Q00000X	\N	\N	\N	\N	\N	f
126800000X	126800000X	Dental Providers	Dental Assistant	\N	An individual who may or may not have completed an accredited dental assisting education program and who aids the dentist in providing patient care services and performs other nonclinical duties in the dental office or other patient care facility.  The scope of the patient care functions that may be legally delegated to the dental assistant varies based on the needs of the dentist the educational preparation of the dental assistant and state dental practice acts and regulations.  Patient care services are provided under the supervision of a dentist.  To avoid misleading the public, no occupational title other than dental assistant should be used to describe this dental auxiliary.	Source: Comprehensive Policy Statement on Dental Auxiliaries, American Dental Association	\N	\N	\N	metaTaxonomyCode:126800000X	\N	\N	\N	\N	\N	f
126900000X	126900000X	Dental Providers	Dental Laboratory Technician	\N	An individual who has the skill and knowledge in the fabrication of dental appliances, prostheses and devices in accordance with a dentist's laboratory work authorization.  To avoid misleading the public, no occupational title other than dental laboratory technician or certified dental technician (when appropriate) should be used to describe this auxiliary.	Source: Comprehensive Policy Statement on Dental Auxiliaries, American Dental Association.	\N	\N	\N	metaTaxonomyCode:126900000X	\N	\N	\N	\N	\N	f
132700000X	132700000X	Dietary & Nutritional Service Providers	Dietary Manager	\N	A dietary manager is a trained food services professional who is charged with maintaining cost/profit objectives, purchasing foods and services for the department and supervising staff.. Dietary managers are trained to understand the basic nutritional needs of clients and work in partnership with dietitians, who offer specialized nutritional expertise. The CDM certified dietary manager designation is an advanced professional credential awarded to dietary managers who have completed specific course work, have passed the national credentialing exams (including a sanitation and safety exam) and have applied for certification.	\N	\N	\N	\N	metaTaxonomyCode:132700000X	\N	\N	\N	\N	\N	f
133N00000X	133N00000X	Dietary & Nutritional Service Providers	Nutritionist	\N	A specialist in adapting and applying food and nutrient knowledge to the solution of food and nutritional problems, the control of disease, and the promotion of health. Nutritionists perform research, instruct groups and individuals about nutritional requirements, and assist people in developing meal patterns that meet their nutritional needs; (2) A nutritionist is someone who has completed undergraduate and/or graduate training in the discipline of nutrition without necessarily meeting the academic and experience requirements to qualify for the Registered Dietitian designation.	Source: (1) Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:133N00000X	\N	\N	\N	\N	\N	f
