136A00000X	136A00000X	Dietary & Nutritional Service Providers	Dietetic Technician, Registered	\N	A person trained in food and nutrition who is an integral part of health care and foodservice management teams. A dietetic technician, registered (DTR) has successfully completed at least a two-year associates degree at a US regionally accredited college or university; a dietetic technician program approved by The American Dietetic Association, including 450 hours of supervised practice experience; a national examination administered by the Commission on Dietetic Registration; and continuing professional educational requirements to maintain registration.	Source: The American Dietetic Association. Becoming a Dietetic Technician, Registered -- a food and nutrition practitioner. Chicago, IL: The American dietetic association, July 1997.	\N	\N	\N	metaTaxonomyCode:136A00000X	\N	\N	\N	\N	\N	f
146L00000X	146L00000X	Emergency Medical Service Providers	Emergency Medical Technician, Paramedic	\N	An EMT, Paramedic is an individual trained and certified to perform advanced life support (ALS) in medical emergencies based on individual state boards.	Sources: Tabers Medical Dictionary and Florida EMS Clearing House.	\N	\N	\N	metaTaxonomyCode:146L00000X	\N	\N	\N	\N	\N	f
146M00000X	146M00000X	Emergency Medical Service Providers	Emergency Medical Technician, Intermediate	\N	An Intermediate EMT is an individual trained and certified to perform intermediate life support treatment in medical emergencies based on individual state boards.	Sources: Tabers Medical Dictionary and Florida EMS Clearing House.	\N	\N	\N	metaTaxonomyCode:146M00000X	\N	\N	\N	\N	\N	f
