164W00000X	164W00000X	Nursing Service Providers	Licensed Practical Nurse	\N	An individual with post-high school vocational training and practical experience in the provision of nursing care at a level less than that required for certification as a Registered Nurse. Requirements for education, experience, licensure, and job responsibilities vary among the states.	Source: Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:164W00000X	\N	\N	\N	\N	\N	f
164X00000X	164X00000X	Nursing Service Providers	Licensed Vocational Nurse	\N	An individual with post-high school vocational training and practical experience in the provision of nursing care at a level less than that required for certification as a Registered Nurse. [An alternate term for licensed practical nurse arising from difference in occupational titles between states and post-high school training programs and institutions.] Requirements for education, experience, licensure, and job responsibilities vary among the states.	Source: Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:164X00000X	\N	\N	\N	\N	\N	f
167G00000X	167G00000X	Nursing Service Providers	Licensed Psychiatric Technician	\N	An individual licensed by the state board as a Psychiatric Technician based upon completion of a prescribed course of theory and clinical practice, with two thirds of the clinical practice time focused on mental and developmental disorders.  The psychiatric technician practices under the direct supervision of a physician, psychologist, registered nurse or other professional to provide care to patients with mental disorders and developmental disabilities.	\N	\N	\N	\N	metaTaxonomyCode:167G00000X	\N	\N	\N	\N	\N	f
170100000X	170100000X	Other Service Providers	Medical Genetics, Ph.D. Medical Genetics	\N	A medical geneticist works in association with a medical specialist, is affiliated with a clinical genetics program, and serves as a consultant to medical and dental specialists. 	A general certificate was first issued by ABMS in 1982.  ACGME Accredited Residency Program Requirements:  None.	\N	\N	\N	metaTaxonomyCode:170100000X	\N	\N	\N	\N	\N	f
170300000X	170300000X	Other Service Providers	Genetic Counselor, MS	\N	A masters trained health care provider who collects and interprets genetic family histories; assesses the risk of disease occurrence or recurrence; identifies interventions to manage or ameliorate disease risk; educates about inheritance, testing, management, prevention, ethical issues, resources, and research; and counsels to promote informed choices and adaptation. Certification was established in 1993 by the American Board of Genetic Counseling and prior to that by the American Board of Medical Genetics. Requirements for experience, licensure, and job responsibilities vary among the states.	Source: National Society of Genetic Counselors [7/1/2005: new]	\N	\N	\N	metaTaxonomyCode:170300000X	\N	\N	\N	\N	\N	f
171000000X	171000000X	Other Service Providers	Military Health Care Provider	\N	Active duty military health care providers not otherwise classified who need to be separately identified for operational, clinical, or administrative processes.	[7/1/2005: new]	\N	\N	\N	metaTaxonomyCode:171000000X	\N	\N	\N	\N	\N	f
1710I1002X	1710I1002X	Other Service Providers	Military Health Care Provider	Independent Duty Corpsman	A Navy Independent Duty Corpsman (IDC) is an active duty Sailor who has successfully completed one of the Navy's specific IDC training programs.  IDCs are formally trained and educated to perform primary medical care and minor surgical services in a variety of health care and non-health care settings worldwide under indirect physician supervision.  IDCs provide care to Department of Defense operational forces and other supporting forces such as contractors and foreign nationals.	Source:  Bureau of Medicine and Surgery, Department of the Navy  [7/1/2005: new]	\N	\N	\N	metaTaxonomyCode:1710I1002X	\N	\N	\N	\N	\N	f
1710I1003X	1710I1003X	Other Service Providers	Military Health Care Provider	Independent Duty Medical Technicians	An Independent Duty Medical Technician (IDMT) is specially trained and educated to perform primary medical care, minor surgical services, and treatment of dental disorders for active duty military members in a variety of health care and non-health care settings worldwide under direct and indirect physician supervision.  An IDMT may take medical histories, perform physical exams, order lab tests and x-rays, prescribe medications, and give immunizations. IDMTs work under the direct supervision of a physician preceptor when at home station and indirectly when assigned to a Mobile Aid Station, Mobile Medical Unit, remote site, or otherwise deployed specifically as an IDMT.  An IDMT may be an experienced Aerospace Medical Service Technician who meets special task qualifications and is recommended for training by the Aerospace Medical Service Functional Manager at their Medical Treatment Facility.  IDMTs maintain certification as Nationally Registered Emergency Medical Technicians and as Immunization Back-up Technicians.	Source:  Air Force Surgeon General Office  [7/1/2005: new]	\N	\N	\N	metaTaxonomyCode:1710I1003X	\N	\N	\N	\N	\N	f
171100000X	171100000X	Other Service Providers	Acupuncturist	\N	An acupuncturist is a person who performs ancient therapy for alleviation of pain, anesthesia and treatment of some diseases. Acupuncturists use long, fine needles inserted into specific points in order to treat painful conditions or produce anesthesia.	\N	\N	\N	\N	metaTaxonomyCode:171100000X	\N	\N	\N	\N	\N	f
