174N00000X	174N00000X	Other Service Providers	Lactation Consultant, Non-RN	\N	An individual trained to provide breastfeeding assistance services to both mothers and infants. Lactation Consultants are not required to be nurses and are trained through specific courses of education. The Lactation Consultant may have additional certification through a national or international organization.	Source: National Uniform Claim Committee [1/1/2011: new]	\N	\N	\N	metaTaxonomyCode:174N00000X	\N	\N	\N	\N	\N	f
174V00000X	174V00000X	Other Service Providers	Clinical Ethicist	\N	A clinical ethicist has been trained in bioethics and ethics case consultation.  The clinical ethicist addresses medical-ethical dilemmas arising in clinical practice, such as end-of-life care, refusal of treatment, and futility of care; assists patients and health care providers with medical decision-making; and provides ethics education for patients and families.	Source: National Uniform Claim Committee [1/1/2011: new]	\N	\N	\N	metaTaxonomyCode:174V00000X	\N	\N	\N	\N	\N	f
175F00000X	175F00000X	Other Service Providers	Naturopath	\N	Diagnoses, treats, and cares for patients, using system of practice that bases treatment of physiological functions and abnormal conditions on natural laws governing human body: Utilizes physiological, psychological, and mechanical methods, such as air, water, light, heat, earth, phototherapy, food and herb therapy, psychotherapy, electrotherapy, physiotherapy, minor and orificial surgery, mechanotherapy, naturopathic corrections and manipulation, and natural methods or modalities, together with natural medicines, natural processed foods, and herbs and nature's remedies. Excludes major surgery, therapeutic use of x ray and radium, and use of drugs, except those assimilable substances containing elements or compounds which are components of body tissues and are physiologically compatible to body processes for maintenance of life.	Source: The Federal Dictionary of Occupational Titles, U.S. Department of Labor, Washington, D.C., section #079, 101-014 [7/1/2007: definition changed, source added]	\N	\N	\N	metaTaxonomyCode:175F00000X	\N	\N	\N	\N	\N	f
175L00000X	175L00000X	Other Service Providers	Homeopath	\N	A provider who is educated and trained in a system of therapeutics in which diseases are treated by drugs which are capable of producing in healthy persons symptoms like those of the disease to be treated. Treatment requires administering a drug in minute doses.	Source: Dorlands Illustrated Medical Dictionary. 26th edition. Philadelphia: W.B. Saunders Company, 1981.	\N	\N	\N	metaTaxonomyCode:175L00000X	\N	\N	\N	\N	\N	f
