207ND0900X	207ND0900X	Allopathic & Osteopathic Physicians	Dermatology	Dermatopathology	A dermatopathologist has the expertise to diagnose and monitor diseases of the skin including infectious, immunologic, degenerative and neoplastic diseases. This entails the examination and interpretation of specially prepared tissue sections, cellular scrapings and smears of skin lesions by means of routine and special (electron and fluorescent) microscopes.	Source: American Board of Medical Specialties, 2007.  www.abms.org  [7/1/2007: added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Dermatology, 2007.  http://www.abderm.org/; American Osteopathic Board of Dermatology, 2007. http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Dermatology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Dermatology.	\N	\N	\N	metaTaxonomyCode:207ND0900X	\N	\N	\N	\N	\N	f
