207QB0002X	207QB0002X	Allopathic & Osteopathic Physicians	Family Medicine	Obesity Medicine	A physician who specializes in the treatment of obesity demonstrates competency in and a thorough understanding of the treatment of obesity and the genetic, biologic, environmental, social, and behavioral factors that contribute to obesity. The obesity medicine physician employs therapeutic interventions including diet, physical activity, behavioral change, and pharmacotherapy. The obesity medicine physician utilizes a comprehensive approach, and may include additional resources such as dietitians, exercise physiologists, mental health professionals and bariatric surgeons as indicated to achieve optimal results. Additionally, the obesity medicine physician maintains competency in providing pre- peri- and post-surgical care of bariatric surgery patients, promotes the prevention of obesity, and advocates for those who suffer from obesity.	Source:  American Board of Obesity Medicine [7/1/2015: title and definition modified]  Additional Resource: American Society of Bariatric Physicians, www.asbp.org.	\N	\N	\N	metaTaxonomyCode:207QB0002X	\N	\N	\N	\N	\N	f
