207ZM0300X	207ZM0300X	Allopathic & Osteopathic Physicians	Pathology	Medical Microbiology	A medical microbiologist is expert in the isolation and identification of microbial agents that cause infectious disease. Viruses, bacteria and fungi, as well as parasites, are identified and, where possible, tested for susceptibility to appropriate antimicrobial agents.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZM0300X	\N	\N	\N	\N	\N	f
207ZN0500X	207ZN0500X	Allopathic & Osteopathic Physicians	Pathology	Neuropathology	A neuropathologist is expert in the diagnosis of diseases of the nervous system and skeletal muscles and functions as a consultant primarily to neurologists and neurosurgeons. The neuropathologist is knowledgeable in the infirmities of humans as they affect the nervous and neuromuscular systems, be they degenerative, infectious, metabolic, immunologic, neoplastic, vascular or physical in nature.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZN0500X	\N	\N	\N	\N	\N	f
207ZP0007X	207ZP0007X	Allopathic & Osteopathic Physicians	Pathology	Molecular Genetic Pathology	A molecular genetic pathologist is expert in the principles, theory and technologies of molecular biology and molecular genetics. This expertise is used to make or confirm diagnoses of Mendelian genetic disorders, disorders of human development, infectious diseases and malignancies, and to assess the natural history of those disorders. A molecular genetic pathologist provides information about gene structure, function and alteration and applies laboratory techniques for diagnosis, treatment and prognosis for individuals with related disorders.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton changed, source changed]    Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.       A subspecialty certificate for MGG was approved by the ABMS in 1999.     ACGME Accredited Residency Program Requirements:  Proposal under development.	\N	\N	\N	metaTaxonomyCode:207ZP0007X	\N	\N	\N	\N	\N	f
2080A0000X	2080A0000X	Allopathic & Osteopathic Physicians	Pediatrics	Adolescent Medicine	A pediatrician who specializes in adolescent medicine is a multi-disciplinary healthcare specialist trained in the unique physical, psychological and social characteristics of adolescents, their healthcare problems and needs.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080A0000X	\N	\N	\N	\N	\N	f
