2080P0205X	2080P0205X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Endocrinology	A pediatrician who provides expert care to infants, children and adolescents who have diseases that result from an abnormality in the endocrine glands (glands which secrete hormones). These diseases include diabetes mellitus, growth failure, unusual size for age, early or late pubertal development, birth defects, the genital region and disorders of the thyroid, the adrenal and pituitary glands.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080P0205X	\N	\N	\N	\N	\N	f
2080P0206X	2080P0206X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Gastroenterology	A pediatrician who specializes in the diagnosis and treatment of diseases of the digestive systems of infants, children and adolescents. This specialist treats conditions such as abdominal pain, ulcers, diarrhea, cancer and jaundice and performs complex diagnostic and therapeutic procedures using lighted scopes to see internal organs.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080P0206X	\N	\N	\N	\N	\N	f
2080P0207X	2080P0207X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Hematology-Oncology	A pediatrician trained in the combination of pediatrics, hematology and oncology to recognize and manage pediatric blood disorders and cancerous diseases.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pediatrics.  The Certification is no longer offered.	\N	\N	\N	metaTaxonomyCode:2080P0207X	\N	\N	\N	\N	\N	f
2080P0208X	2080P0208X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Infectious Diseases	A pediatrician trained to care for children in the diagnosis, treatment and prevention of infectious diseases. This specialist can apply specific knowledge to affect a better outcome for pediatric infections with complicated courses, underlying diseases that predispose to unusual or severe infections, unclear diagnoses, uncommon diseases and complex or investigational treatments.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pediatrics.  The Certification is no longer offered.	\N	\N	\N	metaTaxonomyCode:2080P0208X	\N	\N	\N	\N	\N	f
2080P0210X	2080P0210X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Nephrology	A pediatrician who deals with the normal and abnormal development and maturation of the kidney and urinary tract, the mechanisms by which the kidney can be damaged, the evaluation and treatment of renal diseases, fluid and electrolyte abnormalities, hypertension and renal replacement therapy.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pediatrics.  The Certification is no longer offered.	\N	\N	\N	metaTaxonomyCode:2080P0210X	\N	\N	\N	\N	\N	f
2080P0214X	2080P0214X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Pulmonology	A pediatrician dedicated to the prevention and treatment of all respiratory diseases affecting infants, children and young adults. This specialist is knowledgeable about the growth and development of the lung, assessment of respiratory function in infants and children, and experienced in a variety of invasive and noninvasive diagnostic techniques.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pediatrics.  The Certification is no longer offered.	\N	\N	\N	metaTaxonomyCode:2080P0214X	\N	\N	\N	\N	\N	f
