2080S0010X	2080S0010X	Allopathic & Osteopathic Physicians	Pediatrics	Sports Medicine	A pediatrician who is responsible for continuous care in the field of sports medicine, not only for the enhancement of health and fitness, but also for the prevention of injury and illness. A sports medicine physician must have knowledge and experience in the promotion of wellness and the prevention of injury. Knowledge about special areas of medicine such as exercise physiology, biomechanics, nutrition, psychology, physical rehabilitation, epidemiology, physical evaluation, injuries (treatment and prevention and referral practice) and the role of exercise in promoting a healthy lifestyle are essential to the practice of sports medicine. The sports medicine physician requires special education to provide the knowledge to improve the healthcare of the individual engaged in physical exercise (sports) whether as an individual or in team participation.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080S0010X	\N	\N	\N	\N	\N	f
2080S0012X	2080S0012X	Allopathic & Osteopathic Physicians	Pediatrics	Sleep Medicine	A Pediatrician who practices Sleep Medicine is certified in the subspecialty of sleep medicine and specializes in the clinical assessment, physiologic testing, diagnosis, management and prevention of sleep and circadian rhythm disorders. Sleep specialists treat patients of any age and use multidisciplinary approaches. Disorders managed by sleep specialists include, but are not limited to, sleep related breathing disorders, insomnia, hypersomnias, circadian rhythm sleep disorders, parasomnias and sleep related movement disorders.	Source: American Academy of Sleep Medicine [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:2080S0012X	\N	\N	\N	\N	\N	f
2080T0002X	2080T0002X	Allopathic & Osteopathic Physicians	Pediatrics	Medical Toxicology	Medical toxicologists are physicians that specialize in the prevention, evaluation, treatment and monitoring of injury and illness from exposures to drugs and chemicals, as well as biological and radiological agents. Medical toxicologists care for people in clinical, academic, governmental and public health settings, and provide poison control center leadership. Important areas of medical toxicology include acute drug poisoning, adverse drug events, drug abuse, addiction and withdrawal, chemicals and hazardous materials, terrorism preparedness, venomous bites and stings, and environmental and workplace exposures.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.    ACGME Accredited Residency Program Requirements:  Medical Toxicology (EM) 2 years with 3-4 years Emergency Medicine for a total of 5-6 years; for Medical Toxicology (Preventive Medicine) 2 years with 3 years Preventive Medicine for a total of 5 years.  Medical Toxicology (Pediatrics):  None.    ABMS Approved Subspecialty Certificates (Emergency Medicine) (Pediatrics) (Preventive Medicine)	\N	\N	\N	metaTaxonomyCode:2080T0002X	\N	\N	\N	\N	\N	f
2080T0004X	2080T0004X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Transplant Hepatology	A pediatrician with expertise in transplant hepatology encompasses the special knowledge and skill required of pediatric gastroenterologists to care for patients prior to and following hepatic transplantation	it spans all phases of liver transplantation.	\N	\N	\N	metaTaxonomyCode:2080T0004X	\N	\N	\N	\N	\N	f
208100000X	208100000X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	\N	Physical medicine and rehabilitation, also referred to as rehabilitation medicine, is the medical specialty concerned with diagnosing, evaluating, and treating patients with physical disabilities. These disabilities may arise from conditions affecting the musculoskeletal system such as neck and back pain, sports injuries, or other painful conditions affecting the limbs, such as carpal tunnel syndrome. Alternatively, the disabilities may result from neurological trauma or disease such as spinal cord injury, head injury or stroke. A physician certified in physical medicine and rehabilitation is often called a physiatrist. The primary goal of the physiatrist is to achieve maximal restoration of physical, psychological, social and vocational function through comprehensive rehabilitation. Pain management is often an important part of the role of the physiatrist. For diagnosis and evaluation, a physiatrist may include the techniques of electromyography to supplement the standard history, physical, x-ray and laboratory examinations. The physiatrist has expertise in the appropriate use of therapeutic exercise, prosthetics (artificial limbs), orthotics and mechanical and electrical devices.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Physical Medicine and Rehabilitation, 2007.  http://www.abpmr.org/.  American Osteopathic Board of Physical Medicine and Rehabilitation, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Physical Medicine and Rehabilitation.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Physical Medicine and Rehabilitation.	\N	\N	\N	metaTaxonomyCode:208100000X	\N	\N	\N	\N	\N	f
2081H0002X	2081H0002X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	Hospice and Palliative Medicine	A physical medicine and rehabilitation physician with special knowledge and skills to prevent and relieve the suffering experienced by patients with life-limiting illnesses. This specialist works with an interdisciplinary hospice or palliative care team to maximize quality of life while addressing physical, psychological, social and spiritual needs of both patient and family throughout the course of the disease, through the dying process, and beyond for the family.  This specialist has expertise in the assessment of patients with advanced disease; the relief of distressing symptoms; the coordination of interdisciplinary patient and family-centered care in diverse venues; the use of specialized care systems including hospice; the management of the imminently dying patient; and legal and ethical decision making in end-of-life care.	Source: American Academy of Hospice and Palliative Medicine [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2081H0002X	\N	\N	\N	\N	\N	f
2082S0105X	2082S0105X	Allopathic & Osteopathic Physicians	Plastic Surgery	Surgery of the Hand	A plastic surgeon with additional training in the investigation, preservation, and restoration by medical, surgical and rehabilitative means of all structures of the upper extremity directly affecting the form and function of the hand and wrist.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Plastic Surgery, 2007.  http://www.abplsurg.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Plastic Surgery.	\N	\N	\N	metaTaxonomyCode:2082S0105X	\N	\N	\N	\N	\N	f
2081N0008X	2081N0008X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	Neuromuscular Medicine	A physician who specializes in neuromuscular medicine possesses specialized knowledge in the science, clinical evaluation and management of these disorders. This encompasses the knowledge of the pathology, diagnosis and treatment of these disorders at a level that is significantly beyond the training and knowledge expected of a general neurologist, child neurologist or physiatrist.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: new]    Additional Resources: American Board of Physical Medicine and Rehabilitation, 2007.  http://www.abpmr.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Physical Medicine and Rehabilitation. 	\N	\N	\N	metaTaxonomyCode:2081N0008X	\N	\N	\N	\N	\N	f
2081P0004X	2081P0004X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	Spinal Cord Injury Medicine	A physician who addresses the prevention, diagnosis, treatment and management of traumatic spinal cord injury and non-traumatic etiologies of spinal cord dysfunction by working in an interdisciplinary manner. Care is provided to patients of all ages on a lifelong basis and covers related medical, physical, psychological and vocational disabilities and complications. 	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Physical Medicine and Rehabilitation, 2007.  http://www.abpmr.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Physical Medicine and Rehabilitation.    ACGME Accredited Residency Program Requirements:   1 year of training with 3-5 years in relevant specialty for a total of 4-6 years.    ABMS Approved Subspecialty Certificate:  (Physical Medicine and Rehabilitation)	\N	\N	\N	metaTaxonomyCode:2081P0004X	\N	\N	\N	\N	\N	f
2081P0010X	2081P0010X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	Pediatric Rehabilitation Medicine	A physiatrist who utilizes an interdisciplinary approach and addresses the prevention, diagnosis, treatment and management of congenital and childhood-onset physical impairments including related or secondary medical, physical, functional, psychosocial and vocational limitations or conditions, with an understanding of the life course of disability. This physician is trained in the identification of functional capabilities and selection of the best of rehabilitation intervention strategies, with an understanding of the continuum of care.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Physical Medicine and Rehabilitation, 2007.  http://www.abpmr.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Physical Medicine and Rehabilitation.    A subspecialty certificate for PRM was approved by the ABMS in 1999.    ACGME Accredited Residency Program Requirements:  Early discussions underway	\N	\N	\N	metaTaxonomyCode:2081P0010X	\N	\N	\N	\N	\N	f
2081P0301X	2081P0301X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	Brain Injury Medicine	A Brain Injury Medicine physician specializes in disorders of brain function due to injury and disease.  These disorders encompass a range of medical, physical, neurologic, cognitive, sensory, and behavioral disorders that result in psychosocial, educational, and vocational consequences.	Source: American Board of Physical Medicine and Rehabilitation, 2015 [1/1/2016: new]	\N	\N	\N	metaTaxonomyCode:2081P0301X	\N	\N	\N	\N	\N	f
2081P2900X	2081P2900X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	Pain Medicine	A physician who provides a high level of care, either as a primary physician or consultant, for patients experiencing problems with acute, chronic or cancer pain in both hospital and ambulatory settings. Patient care needs may also be coordinated with other specialists. 	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source changed]    Additional Resources: American Board of Physical Medicine and Rehabilitation, 2007.  http://www.abpmr.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Physical Medicine and Rehabilitation.    A subspecialty certificate  was approved by the ABMS in 1999.    ACGME Accredited Residency Program Requirements:  Proposal under development.	\N	\N	\N	metaTaxonomyCode:2081P2900X	\N	\N	\N	\N	\N	f
2081S0010X	2081S0010X	Allopathic & Osteopathic Physicians	Physical Medicine & Rehabilitation	Sports Medicine	A physician who specializes in Sports Medicine is responsible for continuous care related to the enhancement of health and fitness as well as the prevention of injury and illness. The specialist possesses knowledge and experience in the promotion of wellness and the prevention of injury from many areas of medicine such as exercise physiology, biomechanics, nutrition, psychology, physical rehabilitation, epidemiology, physical evaluation and injuries. It is the goal of a Sports Medicine specialist to improve the healthcare of the individual engaged in physical exercise.	Source:  American Board of Medical Specialties, 2009.  www.abms.org [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:2081S0010X	\N	\N	\N	\N	\N	f
208200000X	208200000X	Allopathic & Osteopathic Physicians	Plastic Surgery	\N	A plastic surgeon deals with the repair, reconstruction or replacement of physical defects of form or function involving the skin, musculoskeletal system, craniomaxillofacial structures, hand, extremities, breast and trunk and external genitalia or cosmetic enhancement of these areas of the body. Cosmetic surgery is an essential component of plastic surgery. The plastic surgeon uses cosmetic surgical principles to both improve overall appearance and to optimize the outcome of reconstructive procedures. The surgeon uses aesthetic surgical principles not only to improve undesirable qualities of normal structures but in all reconstructive procedures as well.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Plastic Surgery, 2007.  http://www.abplsurg.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Plastic Surgery.	\N	\N	\N	metaTaxonomyCode:208200000X	\N	\N	\N	\N	\N	f
2082S0099X	2082S0099X	Allopathic & Osteopathic Physicians	Plastic Surgery	Plastic Surgery Within the Head and Neck	A plastic surgeon with additional training in plastic and reconstructive procedures within the head, face, neck and associated structures, including cutaneous head and neck oncology and reconstruction, management of maxillofacial trauma, soft tissue repair and neural surgery. The field is diverse and involves a wide age range of patients, from the newborn to the aged. While both cosmetic and reconstructive surgery is practiced, there are many additional procedures which interface with them.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Plastic Surgery, 2007.  http://www.abplsurg.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Plastic Surgery.    A subspecialty certificate was approved by the ABMS in 2000.    ACGME Accredited Residency Program Requirements:  None.	\N	\N	\N	metaTaxonomyCode:2082S0099X	\N	\N	\N	\N	\N	f
