2084D0003X	2084D0003X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Diagnostic Neuroimaging	A licensed physician, who has completed a residency program in Neurology, and who has additional training, experience, and competence in the standards of performance and interpretation of Magnetic Resonance Imaging (MRI / MRA) of the head, spine, and peripheral nerves, and Computed Tomography (CT) of the head and spine. Physicians are trained in the administration of contrast media and the recognition and treatment of adverse reactions to contrast media. Neuroimaging training encompasses thorough knowledge of clinical neurology, neurophysiology, neuroanatomy, neurochemistry, neuropharmacology, and dynamics of cerebrospinal fluid circulation.  Physicians possess special expertise in the technical aspects and clinical applications of each of the modalities and techniques of neuroimaging.	Source:  American Academy of Neurology [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2084D0003X	\N	\N	\N	\N	\N	f
2084F0202X	2084F0202X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Forensic Psychiatry	Forensic Psychiatry is a subspecialty with psychiatric focus on interrelationships with civil, criminal and administrative law, evaluation and specialized treatment of individuals involved with the legal system, incarcerated in jails, prisons, and forensic psychiatry hospitals.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084F0202X	\N	\N	\N	\N	\N	f
2084H0002X	2084H0002X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Hospice and Palliative Medicine	A psychiatrist or neurologist with special knowledge and skills to prevent and relieve the suffering experienced by patients with life-limiting illnesses. This specialist works with an interdisciplinary hospice or palliative care team to maximize quality of life while addressing physical, psychological, social and spiritual needs of both patient and family throughout the course of the disease, through the dying process, and beyond for the family.  This specialist has expertise in the assessment of patients with advanced disease; the relief of distressing symptoms; the coordination of interdisciplinary patient and family-centered care in diverse venues; the use of specialized care systems including hospice; the management of the imminently dying patient; and legal and ethical decision making in end-of-life care.	Source: American Academy of Hospice and Palliative Medicine [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2084H0002X	\N	\N	\N	\N	\N	f
2084N0008X	2084N0008X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neuromuscular Medicine	A neurologist or child neurologist who specializes in the diagnosis and management of disorders of nerve, muscle or neuromuscular junction, including amyotrophic lateral sclerosis, peripheral neuropathies (e.g., diabetic and immune mediated neuropathies), various muscular dystrophies, congenital and acquired myopathies, inflammatory myopathies (e.g., polymyositis, inclusion body myositis) and neuromuscular transmission disorders (e.g., myasthenia gravis, Lambert-Eaton myasthenic syndrome).	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: new]    Additional Resources: American Board of Psychiatry and Neurology, 2007.  http://www.abpn.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Psychiatry and Neurology	\N	\N	\N	metaTaxonomyCode:2084N0008X	\N	\N	\N	\N	\N	f
2084N0400X	2084N0400X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neurology	A Neurologist specializes in the diagnosis and treatment of diseases or impaired function of the brain, spinal cord, peripheral nerves, muscles, autonomic nervous system, and blood vessels that relate to these structures.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084N0400X	\N	\N	\N	\N	\N	f
2084P0005X	2084P0005X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neurodevelopmental Disabilities	A pediatrician or neurologist who specializes in the diagnosis and management of chronic conditions that affect the developing and mature nervous system such as cerebral palsy, mental retardation and chronic behavioral syndromes, or neurologic conditions. 	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Psychiatry and Neurology, 2007.  http://www.abpn.org/.      Board certification for Medical Doctors (MDs) is provided by the American Board of Psychiatry and Neurology.    A subspecialty certificate for NDN was approved by the ABMS in 1999.    ACGME Accredited Residency Program Requirements:  Ongoing early discussions regarding proposal.	\N	\N	\N	metaTaxonomyCode:2084P0005X	\N	\N	\N	\N	\N	f
2084P0015X	2084P0015X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Psychosomatic Medicine	Psychosomatic Medicine is subspecialty in the diagnosis and treatment of psychiatric disorders and symptoms in complex medically ill patients. This subspecialty includes treatment of patients with acute or chronic medical, neurological, obstetrical or surgical illness in which psychiatric illness is affecting their medical care and/or quality of life such as HIV infection, organ transplantation, heart disease, renal failure, cancer, stroke, traumatic brain injury, high-risk pregnancy and COPD, among others. Patients also may be those who have a psychiatric disorder that is the direct consequence of a primary medical condition, or a somatoform disorder or psychological factors affecting a general medical condition. Psychiatrists specializing in Psychosomatic Medicine provide consultation-liaison services in general medical hospitals, attend on medical psychiatry inpatient units, and provide collaborative care in primary care and other outpatient settings.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2084P0015X	\N	\N	\N	\N	\N	f
