2084P0800X	2084P0800X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Psychiatry	A Psychiatrist specializes in the prevention, diagnosis, and treatment of mental disorders, emotional disorders, psychotic disorders, mood disorders, anxiety disorders, substance-related disorders, sexual and gender identity disorders and adjustment disorders. Biologic, psychological, and social components of illnesses are explored and understood in treatment of the whole person. Tools used may include diagnostic laboratory tests, prescribed medications, evaluation and treatment of psychological and interpersonal problems with individuals and families, and intervention for coping with stress, crises, and other problems.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084P0800X	\N	\N	\N	\N	\N	f
2084P0802X	2084P0802X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Addiction Psychiatry	Addiction Psychiatry is a subspecialty of psychiatry that focuses on evaluation and treatment of individuals with alcohol, drug, or other substance-related disorders, and of individuals with dual diagnosis of substance-related and other psychiatric disorders.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084P0802X	\N	\N	\N	\N	\N	f
2084P0804X	2084P0804X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Child & Adolescent Psychiatry	Child & Adolescent Psychiatry is a subspecialty of psychiatry with additional skills and training in the diagnosis and treatment of developmental, behavioral, emotional, and mental disorders of childhood and adolescence.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084P0804X	\N	\N	\N	\N	\N	f
