2084S0012X	2084S0012X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Sleep Medicine	A Psychiatrist or Neurologist who practices Sleep Medicine is certified in the subspecialty of sleep medicine and specializes in the clinical assessment, physiologic testing, diagnosis, management and prevention of sleep and circadian rhythm disorders. Sleep specialists treat patients of any age and use multidisciplinary approaches. Disorders managed by sleep specialists include, but are not limited to, sleep related breathing disorders, insomnia, hypersomnias, circadian rhythm sleep disorders, parasomnias and sleep related movement disorders.	Source: American Academy of Sleep Medicine [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:2084S0012X	\N	\N	\N	\N	\N	f
