2086S0102X	2086S0102X	Allopathic & Osteopathic Physicians	Surgery	Surgical Critical Care	A surgeon with expertise in the management of the critically ill and postoperative patient, particularly the trauma victim, who specializes in critical care medicine diagnoses, treats and supports patients with multiple organ dysfunction. This specialist may have administrative responsibilities for intensive care units and may also facilitate and coordinate patient care among the primary physician, the critical care staff and other specialists.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Surgery, 2007.  http://www.absurgery.org/.   American Osteopathic Board of Surgery, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Surgery.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Surgery.	\N	\N	\N	metaTaxonomyCode:2086S0102X	\N	\N	\N	\N	\N	f
2086S0105X	2086S0105X	Allopathic & Osteopathic Physicians	Surgery	Surgery of the Hand	A surgeon with expertise in the investigation, preservation and restoration by medical, surgical and rehabilitative means, of all structures of the upper extremity directly affecting the form and function of the hand and wrist.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Surgery, 2007.  http://www.absurgery.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Surgery.	\N	\N	\N	metaTaxonomyCode:2086S0105X	\N	\N	\N	\N	\N	f
