208U00000X	208U00000X	Allopathic & Osteopathic Physicians	Clinical Pharmacology	\N	Clinical pharmacology encompasses the spectrum of activities related to the discovery, development, regulation, and utilization of safe and effective drugs.	Source: American Society for Clinical Pharmacology and Therapeutics, 2008  [7/1/2008: modified definition]    Additional Resources: Clinical pharmacology is a recognized fellowship program for physicians, pharmacists, and post-doctoral researchers delivered through medical education institutions accredited by the American Board of Clinical Pharmacology. http://www.ascpt.org/; American Board of Clinical Pharmacology http://www.abcp.net/	\N	\N	\N	metaTaxonomyCode:208U00000X	\N	\N	\N	\N	\N	f
208VP0000X	208VP0000X	Allopathic & Osteopathic Physicians	Pain Medicine	Pain Medicine	Pain Medicine is a primary medical specialty based on a distinct body of knowledge and a well-defined scope of clinical practice that is founded on science, research and education.  It is concerned with the study of pain, the prevention of pain, and the evaluation, treatment, and rehabilitation of persons in pain.  A comprehensive evaluation incorporates the physical, psychological, cognitive and socio-cultural contributions to pain.  The treatment protocol may include pharmacological, invasive, behavioral, cognitive, rehabilitative and complementary strategies provided in a concurrent focused and patient specific manner.  The pain medicine physician often serves the patient as a frontline physician regarding their pain, but also may serve as a consultant to other physicians, direct an interdisciplinary/multidisciplinary treatment team, conduct research, or advocate for the patients pain care with public and private agencies.  The Pain Medicine physician may work in variety of settings including office, clinic, hospital, university, or governmental/public agencies.	Source: American Academy of Pain Medicine  The American Board of Pain Medicine provides Board Certification.	\N	\N	\N	metaTaxonomyCode:208VP0000X	\N	\N	\N	\N	\N	f
208VP0014X	208VP0014X	Allopathic & Osteopathic Physicians	Pain Medicine	Interventional Pain Medicine	Interventional Pain Medicine is the discipline of medicine devoted to the diagnosis and treatment of pain and related disorders principally with the application of interventional techniques in managing subacute, chronic, persistent, and intractable pain, independently or in conjunction with other modalities of treatment.	\N	\N	\N	\N	metaTaxonomyCode:208VP0014X	\N	\N	\N	\N	\N	f
209800000X	209800000X	Allopathic & Osteopathic Physicians	Legal Medicine	\N	Legal Medicine is a special field of medicine that focuses on various aspects of medicine and law. Historically, the practice of legal medicine made contributions to medicine as a scientific instrument to solve criminal perplexities. Since World War II, the domain of legal medicine has broadened to include not only aspects of medical science to solve legal and criminal problems but aspects of law as it applies to medicine. Legal Medicine continues to grow as medicolegal issues like medical malpractice and liability, government regulation of health care, issues of tort reform, and moral and ethical complexities presented by technological advances become increasingly prominent. Many medical schools have implemented courses which supply medicolegal instruction for medical students, and many law schools now offer medicolegal courses. Also, dual degree programs in law and medicine have been created to assist physicians to bridge the gap between medicine and the law.	Source: American Board of Legal Medicine 08/1992 [7/1/2009: definition reformatted]    Additional Resources: Training Programs, and/or Fellowships, Preceptorships: Certification available through the American Board of Legal Medicine. ACGME Accredited Residency Program Requirements: None.	\N	\N	\N	metaTaxonomyCode:209800000X	\N	\N	\N	\N	\N	f
211D00000X	211D00000X	Podiatric Medicine & Surgery Service Providers	Assistant, Podiatric	\N	An individual who assists a podiatrist in tasks, such as exposing and developing x-rays; taking and recording patient histories; assisting in biomechanical evaluations and negative castings; preparing and sterilizing instruments and equipment; providing the patient with postoperative instructions; applying surgical dressings; preparing the patient for treatment, padding, and strapping; and performing routine office procedures.	Source: (1) Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, The Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, Illinois: 1994, p. 622.	\N	\N	\N	metaTaxonomyCode:211D00000X	\N	\N	\N	\N	\N	f
