222Q00000X	222Q00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Developmental Therapist	\N	A Developmental Therapist is a person qualified by completion of an approved program in Developmental Therapy and where applicable credentialed by the state and practicing within the scope of the credential, or credentialed by completion of education experiences as approved by the state and practicing within the scope of that credential or, where state credentialing does not exist, certified by the Board of the Developmental Therapy Association. A developmental therapist evaluates children's global development in order to identify areas of developmental delay whether arising from physiological, neurological, or environmental factors, or a combination of factors; and designs, implements, and modifies therapeutic interventions for the child and the family to promote the child's acquisition of skills in a variety of developmental areas, including cognitive processes and social interaction in order to maximize functional independence and developmental homeostasis, and improve the quality of life at home and in the community; and provides consultation for the parents and other professionals working with the family on global development.	Source: The Illinois Developmental Therapists Association [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:222Q00000X	\N	\N	\N	\N	\N	f
222Z00000X	222Z00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Orthotist	\N	A health care professional who is specifically educated and trained to manage comprehensive orthotic patient care, including musculoskeletal and neuromuscular anomalies resulting from injuries or disease processes involving the lower extremity, upper extremity or spinal segment/s and positional deformation of the cranium. Orthotists assess specific patient needs, formulate an appropriate treatment plan, implement the treatment plan and provide follow-up care.	Source:  American Board for Certification in Orthotics, Prosthetics, and Pedorthics, Inc. [7/1/2010: modified, 7/1/2013: modified]  Additional Resources:  American Board for Certification in Orthotics, Prosthetics and Pedorthics, Inc., www.abcop.org and Board of Certification/Accreditation, International, www.bocusa.org.	\N	\N	\N	metaTaxonomyCode:222Z00000X	\N	\N	\N	\N	\N	f
224900000X	224900000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Mastectomy Fitter	\N	An individual trained in the fitting and adjusting of breast prostheses and management of post-mastectomy prostheses services.	Source: National Uniform Claim Committee [7/1/2010: new]  Additional Resources:  American Board for Certification in Orthotics, Prosthetics and Pedorthics, Inc., www.abcop.org and Board of Certification/Accreditation, International, www.bocusa.org.	\N	\N	\N	metaTaxonomyCode:224900000X	\N	\N	\N	\N	\N	f
224L00000X	224L00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Pedorthist	\N	An individual who is trained in the management and treatment of conditions of the foot, ankle, and lower extremities requiring fitting, fabricating, and adjusting of pedorthic devices.	Source: National Uniform Claim Committee [7/1/2010: new]  Additional Resources:  American Board for Certification in Orthotics, Prosthetics and Pedorthics, Inc., www.abcop.org and Board of Certification/Accreditation, International, www.bocusa.org.	\N	\N	\N	metaTaxonomyCode:224L00000X	\N	\N	\N	\N	\N	f
224P00000X	224P00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Prosthetist	\N	A health care professional who is specifically educated and trained to manage comprehensive prosthetic patient care for individuals who have sustained complete or partial limb loss or absence. Prosthetists assess specific patient needs, formulate an appropriate treatment plan, implement the treatment plan and provide follow-up care.	Source:  American Board for Certification in Orthotics, Prosthetics, and Pedorthics, Inc. [7/1/2010: modified, 7/1/2013: modified]  Additional Resources:  American Board for Certification in Orthotics, Prosthetics and Pedorthics, Inc., www.abcop.org and Board of Certification/Accreditation, International, www.bocusa.org.	\N	\N	\N	metaTaxonomyCode:224P00000X	\N	\N	\N	\N	\N	f
224Y00000X	224Y00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Clinical Exercise Physiologist	\N	A Clinical Exercise Physiologist is a health care professional who is trained to work with patients with chronic disease where exercise training has been shown to be of therapeutic benefit, including but not limited to cardiovascular and pulmonary disease, and metabolic disorders.	Source:  What is a Clinical Exercise Physiologist? Clinical Exercise Physiology Association (CEPA), CEPA Executive Board, 2008	\N	\N	\N	metaTaxonomyCode:224Y00000X	\N	\N	\N	\N	\N	f
224Z00000X	224Z00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapy Assistant	\N	An occupational therapy assistant is a person who has graduated from an occupational therapy assistant program accredited by the Accreditation Council for Occupational Therapy Education (ACOTE) or predecessor organizations, has successfully completed a period of supervised fieldwork experience required by the accredited occupational therapy assistant program, has passed a nationally recognized entry-level examination for occupational therapy assistants, and fulfills state requirements for licensure, certification, or registration.  An occupational therapy assistant provides interventions under the supervision of an occupational therapist which emphasize the therapeutic use of everyday life activities (i.e., occupations) with individuals or groups for the purpose of facilitating participation in roles and situations and in home, school, workplace, community and other settings.  Occupational therapy services are provided for the purpose of promoting health and wellness and are provided to those who have or are at risk for developing an illness, injury, disease, disorder, condition, impairment, disability, activity limitation, or participation restriction.  Occupational therapy assistants address the physical, cognitive, psychosocial, sensory, and other aspects of occupational performance in a variety of contexts to support engagement in everyday life activities that affect health, well-being, and quality of life.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: definition changed, source changed]	\N	\N	\N	metaTaxonomyCode:224Z00000X	\N	\N	\N	\N	\N	f
225600000X	225600000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Dance Therapist	\N	The dance therapist, sometimes called a movement therapist, focuses on rhythmic body movements as a medium of physical and psychological change. Dance therapy is practiced more often with mental health patients than with physically disabled patients. A masters degree is required by the American Dance Therapy Association to award the credentials Dance Therapist Registered (DTR).	Source: Joel A. DeLisa and Bruce M. Gans, Rehabilitation Medicine: Principles and Practice Second Edition, J.B. Lippincott Company, Philadelphia: 1993, p. 11	\N	\N	\N	metaTaxonomyCode:225600000X	\N	\N	\N	\N	\N	f
225700000X	225700000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Massage Therapist	\N	An individual trained in the manipulation of tissues (as by rubbing, stroking, kneading, or tapping) with the hand or an instrument for remedial or hygienic purposes.	\N	\N	\N	\N	metaTaxonomyCode:225700000X	\N	\N	\N	\N	\N	f
