225XL0004X	225XL0004X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	Low Vision	Occupational therapists enable children and adults with visual impairment to engage in their chosen daily living activities safely and as independently as possible.  This is accomplished by 1) teaching the person to use their remaining vision as efficiently as possible to complete activities; (2) modifying activities so that they can be completed with less vision; (3) training the person in use of adaptive equipment to compensate for vision loss, including high and low technology assistive devices; and (4) modifying the persons environment.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary specialty certification for a Low Vision Occupational Therapist if the applicant meets the following requirements: <ul> <li>Professional or technical degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 2,000 hours of experience as an occupational therapist or occupational therapy assistant.  <li>600 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 3 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Fact Sheets: Low Vision; OT Services for Individuals with Visual Impairments	\N	\N	\N	metaTaxonomyCode:225XL0004X	\N	\N	\N	\N	\N	f
225XM0800X	225XM0800X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	Mental Health	Occupational therapists provide treatment for people recovering from a mental or physical illness to regain their independence and stability and to engage in normal daily occupations (work, home, family life, school, leisure).  Occupational therapists provide particular emphasis on interventions that result in improved quality of life and decrease hospitalization.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary board certification for a Mental Health Occupational Therapist if the applicant meets the following requirements: <ul> <li>Professional degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 5 years of practice as an occupational therapist.  <li>Minimum of 5,000 hours of experience as an occupational therapist in the certification area in the last 7 calendar years.  <li>Minimum of 500 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 5 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Fact Sheets: Partial Hospitalization Programs and Consumer	\N	\N	\N	metaTaxonomyCode:225XM0800X	\N	\N	\N	\N	\N	f
