261QA0005X	261QA0005X	Ambulatory Health Care Facilities	Clinic/Center	Ambulatory Family Planning Facility	An abortion/family planning facility where services are provided at a fixed specific location.  An Ambulatory Family Planning Facility does not provide overnight accommodations. The following procedures may be performed at an Ambulatory Family Planning Facility: abortions, laproscopy, hysterectomies, tubule ligation and other related procedures. Abortion is considered voluntary termination of pregnancy.	\N	\N	\N	\N	metaTaxonomyCode:261QA0005X	\N	\N	\N	\N	\N	f
261QA0006X	261QA0006X	Ambulatory Health Care Facilities	Clinic/Center	Ambulatory Fertility Facility	A fertility facility, which may be licensed, registered, or certified in some states,  that is not hospital-based, where services are provided at a fixed specific location. An Ambulatory Fertility Facility does not provide overnight accommodations. The following fertility procedures may be performed at an Ambulatory Fertility Facility: In Vitro Fertilization (IVF), Gamete Intrafallopian Transfer (GIFT), Embryo Transfer-Thaw (ET-T), Zygote Intrafallopian Transfer (ZIFT), Donor OOCYTE (DO) 	\N	\N	\N	\N	metaTaxonomyCode:261QA0006X	\N	\N	\N	\N	\N	f
