273100000X	273100000X	Hospital Units	Epilepsy Unit	\N	An Epilepsy Unit is a distinct unit of a hospital that provides services that may include observation, urgent care, diagnostic testing, treatment, and medication management for patients with seizure disorders.	Source:  National Uniform Claim Committee [7/1/2007: new]	\N	\N	\N	metaTaxonomyCode:273100000X	\N	\N	\N	\N	\N	f
273R00000X	273R00000X	Hospital Units	Psychiatric Unit	\N	In general, a distinct unit of a hospital that provides acute or long-term care to emotionally disturbed patients, including patients admitted for diagnosis and those admitted for treatment of psychiatric problems on the basis of physicians orders and approved nursing care plans. Long-term care may include intensive supervision to the chronically mentally ill, mentally disordered or other mentally incompetent persons; (2) For Medicare, a distinct part of a general acute care hospital admitting only patients whose admission to the unit is required for active treatment, whose treatment is of an intensity that can be provided only in an inpatient hospital setting, and whose condition is described by a psychiatric principal diagnosis contained in the Third Edition of the American Psychiatric Association Diagnostic and Statistical Manual or in Chapter 5 (Mental Disorders) of the International Classification of Diseases, Ninth Revision, Clinical Modification (ICD-9-CM). The unit must furnish, through the use of qualified personnel, psychological services, social work services, psychiatric nursing, occupational therapy, and recreational therapy. The unit must maintain medical records that permit determination of the degree and intensity of treatment provided to individuals who are furnished services in the unit; the unit must meet special staff requirements in that the unit must have adequate numbers of qualified professional and supportive staff to evaluate inpatients, formulate written, individualized, comprehensive treatment plans, provide active treatment measures and engage in discharge planning.	Source: (1) AHA Annual Survey p. A10 1996 AHA Guide; (2) Code of Federal Regulations #42, Section 412.27.	\N	\N	\N	metaTaxonomyCode:273R00000X	\N	\N	\N	\N	\N	f
273Y00000X	273Y00000X	Hospital Units	Rehabilitation Unit	\N	In general, a distinct unit of a general acute care hospital that provides care encompassing a comprehensive array of restoration services for the disabled and all support services necessary to help patients attain their maximum functional capacity.  Source: AHA Annual Survey p. A10 1996 AHA Guide.  For Medicare, a distinct part of a general acute care hospital providing inpatient rehabilitation services that meets the following requirements. Rehabilitation Units have in effect a preadmission screening procedure under which each prospective patients condition and medical history are reviewed to determine whether the patient is likely to benefit significantly from an intensive inpatient program or assessment; ensure that the patients receive close medical supervision and furnish, through the use of qualified personnel, rehabilitation nursing, physical therapy and occupational therapy, plus, as needed, speech therapy, social services or psychological services and orthotic and prosthetic services; have a plan of treatment for each inpatient that is established, reviewed, and revised as needed by a physician in consultation with other professional personnel who provide services to the patient; use a coordinated multidisciplinary team approach in the rehabilitation of each inpatient, as documented by periodic clinical entries made in the patients medical record to note the patients status in relationship to goal attainment , and that team conferences are held at least every two weeks to determine the appropriateness of treatment; have a director of rehabilitation who provides services to the unit and its inpatients for at least 20 hours a week, is a doctor of medicine or osteopathy, is licensed under State law to practice medicine or surgery, and has had, after completing a one-year hospital internship at least two years of training or experience in the medical management of inpatients requiring rehabilitation services.	Source: Code of Federal Regulations #42, Section 412.29.	\N	\N	\N	metaTaxonomyCode:273Y00000X	\N	\N	\N	\N	\N	f
275N00000X	275N00000X	Hospital Units	Medicare Defined Swing Bed Unit	\N	A unit of a hospital that has a Medicare provider agreement and has been granted approval from HCFA to provide post-hospital extended care services and be reimbursed as a swing-bed unit.	Source: Code of Federal Regulations #42, Section 482.66.	\N	\N	\N	metaTaxonomyCode:275N00000X	\N	\N	\N	\N	\N	f
276400000X	276400000X	Hospital Units	Rehabilitation, Substance Use Disorder Unit	\N	A distinct part of a hospital that provides medically monitored, interdisciplinary addiction-focused treatment to patients/clients who have psychoactive substance use disorders (commonly referred to as alcohol and drug abuse or substance abuse.)	Source: Department of Defense Regulation 6010.8-R, Chapter 6.	\N	\N	\N	metaTaxonomyCode:276400000X	\N	\N	\N	\N	\N	f
281P00000X	281P00000X	Hospitals	Chronic Disease Hospital	\N	(1) A hospital including a physical plant and personnel that provides multidisciplinary diagnosis and treatment for diseases that have one or more of the following characteristics: is permanent; leaves residual disability; is caused by nonreversible pathological alteration; requires special training of the patient for rehabilitation; and/or may be expected to require a long period of supervision or care. In addition, patients require the safety, security, and shelter of these specialized inpatient or partial hospitalization settings. (2) A hospital that provides medical and skilled nursing services to patients with long-term illnesses who are not in an acute phase but who require an intensity of services not available in nursing homes.	Source: (1) Expanded from Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:281P00000X	\N	\N	\N	\N	\N	f
