2865M2000X	2865M2000X	Hospitals	Military Hospital	Military General Acute Care Hospital	A Department of Defense (DoD) health care organization furnishing inpatient care 24 hours per day in fixed facilities, primarily for DoD beneficiaries. Entity is Defense Health Program (DHP) funded. A fixed facility is a non-temporary, non-deployed facility usually used for health care services. It includes mobile specialty units such as Magnetic Resonance Imaging (MRI) units that may furnish services at the fixed facility. It includes those services and institutional costs usually included in a Diagnosis Related Group as well as pass-through items.	[1/1/2005: title modified,  definition added]	\N	\N	\N	metaTaxonomyCode:2865M2000X	\N	\N	\N	\N	\N	f
2865X1600X	2865X1600X	Hospitals	Military Hospital	Military General Acute Care Hospital. Operational (Transportable)	A Department of Defense (DoD) health care organization furnishing inpatient care 24 hours per day in non-fixed or deployed facilities. Entity is not Defense Health Program funded. Services are primarily intended for DoD active duty though some services may be furnished for non-DoD active duty. Non-fixed facilities are generally deployed DoD health care activities, not providing services on or in association with a DoD fort or base. Non-fixed facilities include hospital ships.	[1/1/2005: title modified,  definition added]	\N	\N	\N	metaTaxonomyCode:2865X1600X	\N	\N	\N	\N	\N	f
