367500000X	367500000X	Physician Assistants & Advanced Practice Nursing Providers	Nurse Anesthetist, Certified Registered	\N	(1) A licensed registered nurse with advanced specialty education in anesthesia who, in collaboration with appropriate health care professionals, provides preoperative, intraoperative, and postoperative care to patients and assists in management and resuscitation of critical patients in intensive care, coronary care, and emergency situations. Nurse anesthetists are certified following successful completion of credentials and state licensure review and a national examination directed by the Council on Certification of Nurse Anesthetists. (2) A registered nurse who is qualified by special training to administer anesthesia in collaboration with a physician or dentist and who can assist in the care of patients who are in critical condition.	Sources: (1) Council on Certification of Nurse Anesthetists, Park Ridge, IL, and Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988. (2) Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, The Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, Illinois: 1994, p. 548.	\N	\N	\N	metaTaxonomyCode:367500000X	\N	\N	\N	\N	\N	f
367A00000X	367A00000X	Physician Assistants & Advanced Practice Nursing Providers	Advanced Practice Midwife	\N	Midwifery practice as conducted by certified nurse-midwives (CNMs) and certified midwives (CMs) is the independent management of women's health care, focusing particularly on pregnancy, childbirth, the post partum period, care of the newborn, and the family planning and gynecologic needs of women. The CNM and CM practice within a health care system that provides for consultation, collaborative management, or referral, as indicated by the health status of the client. CNMs and CMs practice in accord with the Standards for the Practice of Midwifery, as defined by the American College of Nurse-Midwives (ACNM).	Source: American College of Nurse-Midwives, 2008  [7/1/2008: title changed, defintion changed, source changed]  Additional Resources: American College of Nurse-Midwives www.acnm.org. The American Midwifery Certification Board, Inc. [AMCB, formerly the ACNM Certification Council, Inc. (ACC)] opened its national certification exam to non-nurse graduates of midwifery education programs and issued the first certified midwife (CM) credential in 1997. Certified midwives are educated to meet the same high standards that certified nurse-midwives must meet. These are the standards that every state in the U.S. has recognized as the legal basis for nurse-midwifery practice. All education programs for CMs, like CNMs, award a post-baccalaureate certificate or higher degree. CMs take the same AMCB certification exam as CNMs and study side by side with nurse-midwifery students in some education programs. As an organization, ACNM supports efforts to legally recognize CMs as qualified midwifery practitioners granted the same rights and responsibilities as CNMs.	\N	\N	\N	metaTaxonomyCode:367A00000X	\N	\N	\N	\N	\N	f
367H00000X	367H00000X	Physician Assistants & Advanced Practice Nursing Providers	Anesthesiologist Assistant	\N	An individual certified by the state to perform anesthesia services under the direct supervision of an anesthesiologist.  Anesthesiologist Assistants are required to have a bachelor's degree with a premed curriculum prior to entering a two-year anesthesiology assistant program, which is focused upon the delivery and maintenance of anesthesia care as well as advanced patient monitoring techniques.  An Anesthesiologist Assistant must work as a member of the anesthesia care team under the direction of a qualified Anesthesiologist.	\N	\N	\N	\N	metaTaxonomyCode:367H00000X	\N	\N	\N	\N	\N	f
372500000X	372500000X	Nursing Service Related Providers	Chore Provider	\N	An individual who provides home maintenance services required to sustain a safe, sanitary living environment for individuals who because of age or disabilities is unable to perform the activities.  These services include heavy household chores such as washing floors, windows, and walls; tacking down loose rugs and tiles; and moving heavy items of furniture in order to provide safe access and egress.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:372500000X	\N	\N	\N	\N	\N	f
372600000X	372600000X	Nursing Service Related Providers	Adult Companion	\N	An individual who provides supervision, socialization, and non-medical care to a functionally impaired adult.  Companions may assist or supervise the individual with such tasks as meal preparation, laundry and shopping, but do not perform these activities as discrete services.  These services are provided in accordance with a therapeutic goal in the plan of care.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:372600000X	\N	\N	\N	\N	\N	f
373H00000X	373H00000X	Nursing Service Related Providers	Day Training/Habilitation Specialist	\N	Individuals experienced or trained in working with developmentally disabled individuals who need assistance in acquiring and maintaining life skills that enable them to cope more effectively with the demands of independent living.	\N	\N	\N	\N	metaTaxonomyCode:373H00000X	\N	\N	\N	\N	\N	f
374700000X	374700000X	Nursing Service Related Providers	Technician	\N	(1) A person with specialized training in a narrow field of expertise whose occupation requires training and is skilled in specific technical processes and procedures. (2) An individual having special skill or practical knowledge in an area, such as operation and maintenance of equipment or performance of laboratory procedures involving biochemical analyses. Special technical qualifications are normally required, though an increasing number or technicians also possess university degrees in science, and occasionally doctorate degrees. The distinction between technician and technologist in the health care field is not always clear.	Sources: (1) Rhea, Ott, and Shafritz, The Facts on File Dictionary of Health Care Management, New York: Facts on File Publications, 1988; Dorlands Illustrated Medical Dictionary, 26th Edition, Philadelphia: W.B. Saunders Company, 1981 and Websters II New Riverside University Dictionary, Boston: Riverside Publishing Company, 1984. (2) ) Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, The Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, Illinois: 1994, p. 776.	\N	\N	\N	metaTaxonomyCode:374700000X	\N	\N	\N	\N	\N	f
3747A0650X	3747A0650X	Nursing Service Related Providers	Technician	Attendant Care Provider	An individual who provides hands-on care, of both a supportive and health related nature, specific to the needs of a medically stable, physically handicapped individual.  Supportive services are those that substitute for the absence, loss, diminution, or impairment of a physical or cognitive function.  This service may include skilled or nursing care to the extent permitted by state law.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:3747A0650X	\N	\N	\N	\N	\N	f
3747P1801X	3747P1801X	Nursing Service Related Providers	Technician	Personal Care Attendant	An individual who provides assistance with eating, bathing, dressing, personal hygiene, activities of daily living as specified in the plan of care.  Services which are incidental to the care furnished, or essential to the health and welfare of the individual may also be provided.  Personal care providers must meet state defined training and certification standards	[7/1/2003: definition added]	\N	\N	\N	metaTaxonomyCode:3747P1801X	\N	\N	\N	\N	\N	f
374K00000X	374K00000X	Nursing Service Related Providers	Religious Nonmedical Practitioner	\N	A religious nonmedical practitioner offers spiritually-based care.  Services may be rendered in an office, home, or care facility or by phone, email, or written correspondence.	Source: National Uniform Claim Committee , 2009 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:374K00000X	\N	\N	\N	\N	\N	f
374T00000X	374T00000X	Nursing Service Related Providers	Religious Nonmedical Nursing Personnel	\N	Religious nonmedical nursing personnel are experienced in caring for the physical needs of nonmedical patients.  For example, caring for the physical needs such as assistance with activities of daily living; assistance with moving, positioning, and ambulation; nutritional needs; and comfort and support measures.	Source:  Centers for Medicare & Medicaid Services [7/1/2009: title modified, definition modified]  Additional Resources: www.cms.hhs.gov/CertificationandComplianc/19_RNHCIs.asp   2005 Code of Federal Regulations, Title 42, Chapter IV, Part 403, Subpart G, 403.702 Definitions and Terms	\N	\N	\N	metaTaxonomyCode:374T00000X	\N	\N	\N	\N	\N	f
374U00000X	374U00000X	Nursing Service Related Providers	Home Health Aide	\N	A person trained to assist public health nurses, home health nurses, and other health professionals in the bedside care of patients in their homes.	Source: Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:374U00000X	\N	\N	\N	\N	\N	f
376G00000X	376G00000X	Nursing Service Related Providers	Nursing Home Administrator	\N	An individual, often licensed by the state, who is responsible for the management of a nursing home.	Source: Lexikon: Dictionary of Health Care Terms, Organizations, and Acronyms for the Era of Reform, Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, IL, 1994, p. 552.	\N	\N	\N	metaTaxonomyCode:376G00000X	\N	\N	\N	\N	\N	f
376J00000X	376J00000X	Nursing Service Related Providers	Homemaker	\N	An individual who provides general household activities such as meal preparation, laundry, and light housekeeping, when the individual regularly responsible for these activities is temporarily absent or unable to provide for himself.  Homemakers must meet the state defined training standards.	[7/1/2003: definition added]	\N	\N	\N	metaTaxonomyCode:376J00000X	\N	\N	\N	\N	\N	f
376K00000X	376K00000X	Nursing Service Related Providers	Nurse's Aide	\N	(1) An unlicensed individual who is trained to function in an assistive role to the licensed nurse in the provision of patient/client activities as delegated by the nurse; (2) An individual trained (either on-the-job or through a formal course generally of less than one year) and experienced in performing patient or client-care nursing tasks that do not require the skills of a specialist, technician, or professional. Examples of tasks performed by nurses aides include changing clothes, diapers, and beds; assisting patients to perform exercises or personal hygiene tasks, and supporting communication or social interaction. Specific education and credentials are not required for this work.	Source: (1) American Nurses Association, Registered Professional Nurses and Unlicensed Personnel, 2nd ed., 1996; (2) Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:376K00000X	\N	\N	\N	\N	\N	f
385H00000X	385H00000X	Respite Care Facility	Respite Care	\N	Definition to come.	\N	\N	\N	\N	metaTaxonomyCode:385H00000X	\N	\N	\N	\N	\N	f
385HR2050X	385HR2050X	Respite Care Facility	Respite Care	Respite Care Camp	A camping facility that provides specialized respite care to individuals requiring enhanced services to enable them to remain in the community, (e.g., those with developmental delays, mental retardation, mental/behavioral disorders).  The staff must have training in working with the target populations and dealing with emergency situations which might be related to or exacerbate the individual's condition.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:385HR2050X	\N	\N	\N	\N	\N	f
385HR2055X	385HR2055X	Respite Care Facility	Respite Care	Respite Care, Mental Illness, Child	A facility or distinct part of a facility that provides short term, residential care to children, diagnosed with mental illness, as respite for the regular caregivers.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:385HR2055X	\N	\N	\N	\N	\N	f
385HR2060X	385HR2060X	Respite Care Facility	Respite Care	Respite Care, Mental Retardation and/or Developmental Disabilities, Child	A facility or distinct part of a facility that provides short term, residential care to children, diagnosed with mental retardation and/or developmental disabilities as respite for the regular caregivers.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:385HR2060X	\N	\N	\N	\N	\N	f
385HR2065X	385HR2065X	Respite Care Facility	Respite Care	Respite Care, Physical Disabilities, Child	A facility or distinct part of a facility that providers short term, residential care to children, diagnosed with complex or profound disabilities as respite for the regular caregivers.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:385HR2065X	\N	\N	\N	\N	\N	f
390200000X	390200000X	Student, Health Care	Student in an Organized Health Care Education/Training Program	\N	An individual who is enrolled in an organized health care education/training program leading to a degree, certification, registration, and/or licensure to provide health care. 	[1/1/2005: new]	\N	\N	\N	metaTaxonomyCode:390200000X	\N	\N	\N	\N	\N	f
405300000X	405300000X	Other Service Providers	Prevention Professional	\N	Prevention Professionals work in programs aimed to address specific patient needs, such as suicide prevention, violence prevention, alcohol avoidance, drug avoidance, and tobacco prevention.   The goal of the program is to reduce the risk of relapse, injury, or re-injury of the patient.  Prevention Professionals work in a variety of settings and provide appropriate case management, mediation, referral, and mentorship services.  Individuals complete prevention professionals training for the population of patients with whom they work.	Source: National Uniform Claim Committee, 2015 [1/1/2016: new]	\N	\N	\N	metaTaxonomyCode:405300000X	\N	\N	\N	\N	\N	f
